import { StatusBar } from 'expo-status-bar';
import { NativeBaseProvider, Box } from 'native-base';
import Home from './src/Home'


export default function App() {

  return (
    <NativeBaseProvider>
        <Home/>
      <StatusBar style="auto" />
    </NativeBaseProvider>
  );
}
